import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import bgImage from './fondo_login.jpg';
import logo from './logo_blanco.png';

const Container = styled.div`
    display: flex;
    height: 100vh;
    width: 100vw;
    position: relative;
    background-image: url(${bgImage});
    background-size: cover;
    background-position: center;
`;

const BlurOverlay = styled.div`
    position: absolute;
    top: 0;
    right: 0;
    width: 100%;
    height: 100%;
    background: rgba(103, 21, 125, 0.4);
    backdrop-filter: blur(15px);
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: 20px;
`;

const Logo = styled.img`
    width: 200px;
    height: auto;
    margin-bottom: 20px;
`;

const Title = styled.h1`
    font-family: 'Hint Vadodara', sans-serif;
    color: white;
    font-size: 2rem;
    text-align: center;
    margin: 0;
`;

const ContentContainer = styled.div`
    display: flex;
    flex-direction: column;
    width: 70%;
    background: rgba(255, 255, 255, 0.9);
    padding: 20px;
    border-radius: 10px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    overflow: hidden;
    max-height: 70vh;
    overflow-y: auto;
    @media (max-width: 768px) {
        width: 90%;
    }
`;

const Select = styled.select`
    width: 100%;
    padding: 10px;
    margin-bottom: 20px;
    border-radius: 5px;
    border: 1px solid #ccc;
`;

const Table = styled.table`
    width: 100%;
    border-collapse: collapse;
`;

const TableHeader = styled.th`
    background: #213B6B;
    color: white;
    padding: 10px;
    border: 1px solid #ccc;
    text-align: left;
`;

const TableData = styled.td`
    padding: 10px;
    border: 1px solid #ccc;
    text-align: left;
`;

const Button = styled.button`
    padding: 10px 20px;
    border-radius: 50px;
    border: none;
    background: #213B6B;
    box-shadow: 0px 4px 8px rgba(101, 91, 127, 0.3);
    color: white;
    font-family: 'Hint Vadodara', sans-serif;
    font-size: 1rem;
    font-weight: 400;
    cursor: pointer;
    transition: background 0.3s;
    &:hover {
        background: #67157D;
    }
`;

const ButtonContainer = styled.div`
    margin-top: 20px;
    display: flex;
    gap: 10px;
`;

const DeleteButton = styled(Button)`
    background: #e74c3c;
    &:hover {
        background: #c0392b;
    }
`;

const AsignacionEmprendimientos = ({ navigate }) => {
    const [evaluadores, setEvaluadores] = useState([]);
    const [emprendimientos, setEmprendimientos] = useState([]);
    const [selectedEvaluadorId, setSelectedEvaluadorId] = useState('');
    const [selectedEmprendimientos, setSelectedEmprendimientos] = useState([]);
    const [assignments, setAssignments] = useState([]);

    useEffect(() => {
        // Simulación de llamada a API para obtener evaluadores
        const fetchEvaluadores = async () => {
            const response = {
                ok: true,
                data: [
                    {
                        _id: "668d9256a9e4591afd2ba890",
                        nombre: "Evaluador 1",
                        idIES: "66736b2317fb868463e7e60c",
                        telefono: "telEval1",
                        correo: "correoEval1@correo.com",
                        idPais: "66736b2317fb868463e7e60c"
                    },
                    {
                        _id: "668d943f6376d4e5b7d5c029",
                        nombre: "Evaluador 2",
                        idIES: "66736fde17fb868463e7e613",
                        telefono: "telEval2",
                        correo: "correoEval2@correo.com",
                        idPais: "66736b2317fb868463e7e60c"
                    }
                ]
            };
            setEvaluadores(response.data);
        };

        fetchEvaluadores();
    }, []);

    useEffect(() => {
        // Simulación de llamada a API para obtener emprendimientos
        const fetchEmprendimientos = async () => {
            const response = {
                ok: true,
                data: [
                    {
                        proyectosNoAsociados: [
                            {
                                _id: "669822307dd98655ecb51880",
                                idSector: "66957196c82228c4e3901648",
                                idIES: "66957e598d1d1da498ff9a49",
                                idEmprendedor: "66957f838d1d1da498ff9a5d",
                                fecha: "2011/11/11",
                                fechaInscripcion: 2024,
                                estado: "Crecimiento",
                                numeroEmprendimiento: 4
                            },
                            {
                                _id: "6698223f7dd98655ecb5189a",
                                idSector: "66957196c82228c4e3901648",
                                idIES: "66957e598d1d1da498ff9a49",
                                idEmprendedor: "66957f838d1d1da498ff9a5d",
                                fecha: "2012/12/12",
                                fechaInscripcion: 2024,
                                estado: "Crecimiento",
                                numeroEmprendimiento: 5
                            },
                            {
                                _id: "6699b17e7dd98655ecb518b4",
                                idSector: "66957196c82228c4e3901648",
                                idIES: "66957e8d8d1d1da498ff9a4b",
                                idEmprendedor: "66957fbf8d1d1da498ff9a5f",
                                fecha: "2012/12/12",
                                fechaInscripcion: 2024,
                                estado: "Lanzamiento Temprano",
                                numeroEmprendimiento: 6
                            }
                        ]
                    }
                ]
            };
            setEmprendimientos(response.data[0].proyectosNoAsociados);
        };

        fetchEmprendimientos();
    }, []);

    const handleEvaluadorChange = (event) => {
        setSelectedEvaluadorId(event.target.value);
    };

    const handleEmprendimientoSelect = (emprendimientoId) => {
        setSelectedEmprendimientos(prev => 
            prev.includes(emprendimientoId)
                ? prev.filter(id => id !== emprendimientoId)
                : [...prev, emprendimientoId]
        );
    };

    const handleAsignar = () => {
        if (selectedEvaluadorId && selectedEmprendimientos.length > 0) {
            const newAssignment = {
                evaluadorId: selectedEvaluadorId,
                emprendimientoIds: selectedEmprendimientos
            };
            setAssignments(prev => [...prev, newAssignment]);
            setSelectedEvaluadorId('');
            setSelectedEmprendimientos([]);
            console.log('Nueva asignación:', newAssignment);
        } else {
            alert('Por favor, seleccione un evaluador y al menos un emprendimiento.');
        }
    };

    const handleDeleteAssignment = (index) => {
        setAssignments(prev => prev.filter((_, i) => i !== index));
    };

    const handleLimpiar = () => {
        setAssignments([]);
        setSelectedEvaluadorId('');
        setSelectedEmprendimientos([]);
    };

    const handleInicioAdminClick = () => {
        navigate('inicio_admin');
    };

    return (
        <Container>
            <BlurOverlay>
                <Logo src={logo} alt="Logo" />
                <Title>Asignación de Emprendimientos para Evaluación</Title>
                <ContentContainer>
                    <Select value={selectedEvaluadorId} onChange={handleEvaluadorChange}>
                        <option value="">Seleccione un evaluador</option>
                        {evaluadores.map(evaluador => (
                            <option key={evaluador._id} value={evaluador._id}>
                                {evaluador.nombre}
                            </option>
                        ))}
                    </Select>

                    {selectedEvaluadorId && (
                        <Table>
                            <thead>
                                <tr>
                                    <TableHeader>Número</TableHeader>
                                    <TableHeader>Fecha</TableHeader>
                                    <TableHeader>Estado</TableHeader>
                                    <TableHeader>Seleccionar</TableHeader>
                                </tr>
                            </thead>
                            <tbody>
                                {emprendimientos.map(emprendimiento => (
                                    <tr key={emprendimiento._id}>
                                        <TableData>{emprendimiento.numeroEmprendimiento}</TableData>
                                        <TableData>{emprendimiento.fecha}</TableData>
                                        <TableData>{emprendimiento.estado}</TableData>
                                        <TableData>
                                            <input
                                                type="checkbox"
                                                checked={selectedEmprendimientos.includes(emprendimiento._id)}
                                                onChange={() => handleEmprendimientoSelect(emprendimiento._id)}
                                            />
                                        </TableData>
                                    </tr>
                                ))}
                            </tbody>
                        </Table>
                    )}

                    <ButtonContainer>
                        <Button onClick={handleAsignar}>Asignar</Button>
                        <Button onClick={handleLimpiar}>Limpiar Todo</Button>
                        <Button onClick={handleInicioAdminClick}>Regresar</Button>
                    </ButtonContainer>

                    {assignments.length > 0 && (
                        <Table>
                            <thead>
                                <tr>
                                    <TableHeader>ID Evaluador</TableHeader>
                                    <TableHeader>IDs Emprendimientos</TableHeader>
                                    <TableHeader>Acción</TableHeader>
                                </tr>
                            </thead>
                            <tbody>
                                {assignments.map((assignment, index) => (
                                    <tr key={index}>
                                        <TableData>{assignment.evaluadorId}</TableData>
                                        <TableData>{assignment.emprendimientoIds.join(', ')}</TableData>
                                        <TableData>
                                            <DeleteButton onClick={() => handleDeleteAssignment(index)}>Eliminar</DeleteButton>
                                        </TableData>
                                    </tr>
                                ))}
                            </tbody>
                        </Table>
                    )}
                </ContentContainer>
            </BlurOverlay>
        </Container>
    );
};

export default AsignacionEmprendimientos;
